import './App.css';
import DataTable from './DataTable';
import Signup from './Signup';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {


  return (
    <div >
       <Router>
      <Routes>
        <Route path="/" element={<Signup />} />
        <Route path="/dataTable" element={<DataTable />} />
      </Routes>
    </Router>

    </div>
  );
};

export default App;
